selector_to_html = {"a[href=\"#duplicate-barcode-detection-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configura\u00e7\u00f5es duplicadas de detec\u00e7\u00e3o de c\u00f3digo de barras<a class=\"headerlink\" href=\"#duplicate-barcode-detection-settings\" title=\"Link to this heading\">#</a></h2><h3>Desligado<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/02771.png\"><img alt=\"../../media/02771.png\" src=\"../../media/02771.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Habilitado</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#repeat-barcode-interval\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Repetir Intervalo de C\u00f3digo de Barras<a class=\"headerlink\" href=\"#repeat-barcode-interval\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id12\"]": "<figure class=\"align-center\" id=\"id12\">\n<a class=\"reference internal image-reference\" href=\"../../media/026332.png\"><img alt=\"../../media/026332.png\" src=\"../../media/026332.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">5s</span><a class=\"headerlink\" href=\"#id12\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#scan-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de Escaneo<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Modo de disparo de chaves<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Pressione o bot\u00e3o para acionar a varredura e solte o bot\u00e3o para terminar a verifica\u00e7\u00e3o. A verifica\u00e7\u00e3o termina quando a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de leitura exceder o tempo de leitura \u00fanico.</p>", "a[href=\"#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de Detec\u00e7\u00e3o Autom\u00e1tica<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>No modo de detec\u00e7\u00e3o autom\u00e1tica, o scanner detectar\u00e1 o brilho do ambiente ao redor. Quando o brilho muda, a varredura \u00e9 ativada. A verifica\u00e7\u00e3o termina quando a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de verifica\u00e7\u00e3o exceder o tempo de trabalho \u00fanico. Independentemente de a \u00faltima verifica\u00e7\u00e3o ter sido bem-sucedida ou falhada, o brilho do ambiente ao redor ser\u00e1 detectado novamente.</p>", "a[href=\"#id1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Desligado<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/02311.png\"><img alt=\"../../media/02311.png\" src=\"../../media/02311.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Habilitado</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/02770.png\"><img alt=\"../../media/02770.png\" src=\"../../media/02770.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Desativar</span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/02630A.png\"><img alt=\"../../media/02630A.png\" src=\"../../media/02630A.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">1s</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de disparo de chaves<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Pressione o bot\u00e3o para acionar a varredura e solte o bot\u00e3o para terminar a verifica\u00e7\u00e3o. A verifica\u00e7\u00e3o termina quando a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de leitura exceder o tempo de leitura \u00fanico.</p>", "a[href=\"#id2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Habilitado<a class=\"headerlink\" href=\"#id2\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id13\"]": "<figure class=\"align-center\" id=\"id13\">\n<a class=\"reference internal image-reference\" href=\"../../media/026364.png\"><img alt=\"../../media/026364.png\" src=\"../../media/026364.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">10s</span><a class=\"headerlink\" href=\"#id13\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#enable\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Habilitado<a class=\"headerlink\" href=\"#enable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/02310.png\"><img alt=\"../../media/02310.png\" src=\"../../media/02310.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Desativar</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id11\"]": "<figure class=\"align-center\" id=\"id11\">\n<a class=\"reference internal image-reference\" href=\"../../media/02631E.png\"><img alt=\"../../media/02631E.png\" src=\"../../media/02631E.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">3 segundos</span><a class=\"headerlink\" href=\"#id11\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id10\"]": "<figure class=\"align-center\" id=\"id10\">\n<a class=\"reference internal image-reference\" href=\"../../media/026314.png\"><img alt=\"../../media/026314.png\" src=\"../../media/026314.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">2s</span><a class=\"headerlink\" href=\"#id10\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../media/013300.png\"><img alt=\"../../media/013300.png\" src=\"../../media/013300.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Modo de disparo de teclas</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../media/013304.png\"><img alt=\"../../media/013304.png\" src=\"../../media/013304.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Modo cont\u00ednuo</span><a class=\"headerlink\" href=\"#id4\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#disable\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Desligado<a class=\"headerlink\" href=\"#disable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo cont\u00ednuo<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>O scanner funciona continuamente. Se a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de verifica\u00e7\u00e3o exceder o tempo de trabalho \u00fanico, a verifica\u00e7\u00e3o atual termina. Se o tempo exceder o tempo especificado, a pr\u00f3xima verifica\u00e7\u00e3o \u00e9 ativada automaticamente.</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
